function initializeV3Captcha() {
    var head = document.getElementsByTagName('head')[0];
    var script = document.createElement('script');
    script.type = 'text/javascript';
    var promise = new Promise(function(resolve, reject) {
        script.onload = function() {
            grecaptcha.ready(function() {
                grecaptcha.execute('6LdZKrAUAAAAAEm153TQgpfJWZtL3QV91cySrMT6', {action: 'submit'}).then(function(token) {
                    addingTokens(token);
                    resolve('done');
                });
            });
        };
    });
    script.src = "https://www.google.com/recaptcha/api.js?render=6LdZKrAUAAAAAEm153TQgpfJWZtL3QV91cySrMT6";
    head.appendChild(script);
    return promise;
}

