    var captchaMultipleTokens = document.querySelectorAll('.js_captcha_token');
    captchaToken && (captchaToken.value = token);

    captchaMultipleTokens && [].forEach.call(captchaMultipleTokens, function(el) {
        el.value = token;
    });
}

